import React, { useEffect, useState } from 'react'
import "../styles/Countdown.css"
const CountDown = () => {


   const date=new Date();
   var seconds = date.getSeconds();
var minutes = date.getMinutes();
var hour = date.getHours();


    return (
        <div className="countdown">

         <h1>{hour}:</h1>
         <h1>{minutes}:</h1>
         <h1>{seconds}</h1>

        </div>
    )
}

export default CountDown
